(5, 364, 'Se revisan gafas que no habia traido Lectura= +1.50/+1.25\r\nSubj lectura cerca AO es *1.00 AO, por lo que no se cambian gafas', 9, '2014-02-12 11:39:09'),
(6, 101, 'AV= AO: 20/20  SK= -0.50-0.25V30/-0.50-0.50X170\r\nBIO/M=  AO: Excelente evolución, cornea trasparente, no tinción.\r\nC/ Revision en 2 meses', 9, '2014-01-15 15:26:48'),
(8, 218, 'Se ordena gafas -1.75-0.25*0/-1.25', 9, '2014-01-22 08:45:13'),
(9, 209, 'Se formula tto de Rosacea ocular: doxiciclina, trazidex, Spriner, Hialtears', 9, '2014-01-17 14:20:55'),
(10, 599, 'Por su actividad, permanente uso de vision lejana y cercana se recomienda Lente intraocular Multifocal Tecnics 1', 9, '2014-03-12 14:16:49'),
(11, 506, 'POR ANGULO ESTRECHO REQUIERE IRIDOTOMIA LASER AMBOS OJOS', 9, '2014-02-26 16:14:23'),
(12, 227, 'OCT Del 24/01/2.14: \r\nC/D= 0.69/0.75  C/D Vert= 0.66/0.74  CFN= 80/65  CFNV= 107/95\r\nMorfología: OD normal 360ª/OI: 2h fuera nasal superio, 1 limite, resto normal  ccg= disminuida 360ª AO', 9, '2014-01-27 10:08:36'),
(13, 845, 'Fue Evaluada anteriormente por Dra Ma Victoria Cadavid= AV: 20/50-2/2025-2  SK: -2.00/-1.50 \r\nSubjetivo= -0.75/-0.25', 9, '2014-04-04 12:08:27'),
(14, 880, 'Usa gafas de lectura + 2.25 AO, mejor sin cilindro', 9, '2014-04-08 17:18:34'),
(15, 906, 'Antecedente ocular de Cirugía catarata AO hace mas de 10 años', 9, '2014-04-10 15:48:49'),
(16, 1016, 'El pentacam es normal desde el punto de Belin Ambrosio, pero tiene aberraciones altas, principalmente coma alto: Observar', 9, '2014-05-21 10:58:38'),
(17, 1131, 'Se ordeno otras gafas progresivas para usar cuando tiene los lentes de contacto:\r\nn-1.50*175/-0.25-2.50*5add+2.25 SolaHDV', 9, '2014-06-06 08:15:57'),
(18, 1191, 'En Formula de gafas para cerca quedo con Add en OI solamente, que no se suprimio, la formulaes=\r\nLectura: +4.75/+5.50-0.50*170 Thin & Lite', 9, '2014-06-11 11:34:36'),
(19, 1104, 'Trae OCT de Mácula del 27 de Mayo 2014 que muestra Membrana Epiretiniana y Edema Macular en OD. Se remite a Retina para manejo de su maculopatía antes de la Cirugía de Catarata', 9, '2014-06-16 11:46:17'),
(20, 1483, '', 22, '2014-07-01 15:15:00'),
(21, 1425, 'Pide formula de gafas= Se formula:\r\nOD= +1.75-3.25 x 175°\r\nOS=  +0.25-1.00 x 30° ', 9, '2014-07-03 09:15:40'),
(22, 1389, 'LOS LENTES DE CONTACTO DE DOÑA ANGELA MEJIA SON  ASI OD: -0.75   EN OS:-1.75 EN OASYS.', 22, '2014-07-15 12:57:47'),
(23, 1607, 'SK cicloplegica= OD: -9.75-1.25x55\r\n                           OS: -2.25-2.25x147\r\nFdO= Dilatado: Periferia normal', 9, '2014-07-22 11:11:29'),
(24, 1810, 'Le recomendaron en optica cambiar a progresivo, en vez de Flat/Top. Le colocaron Autograph Trivex transition:\r\n+4.25/+3.75  add +2.50, a veces  ve borroso. Se explica\r\nP/ Iridotomia Laser Ambos Ojos', 9, '2014-07-30 12:03:49'),
(25, 2105, 'Se realiza Paquimetria: OD=553/OS=541', 9, '2014-08-01 10:13:15'),
(26, 1625, 'Refiere poca mejoría con tratamiento doxiciclina, trazidex ung y hialtears. Se cambia a unguento Protopic 0.03% y Disalot. Se cita para redilatar puntos', 9, '2014-08-12 12:24:52'),
(27, 2070, 'Trea OCT de Macula: OD= Coroidopatía Serosa Central. OS= Normal\r\nC/ Se explica patología, se dan indicaciones para disminuir stress, se formula Trusopt gotas c/12h y Control en 45 dias', 9, '2014-08-15 11:50:47'),
(28, 2738, 'LdC ACUVUE 2  Poder -2.00', 9, '2014-08-19 14:49:15'),
(29, 2255, 'En la formula del OS por error quedo +8.00-1.75x170 y la formula real es -8.00-1.75x170', 9, '2014-08-21 09:35:39'),
(30, 2762, 'CONTINUAR CON PREDNISOLONA 1% 2 AL DIA, 3 A OFTENO 3 AL DIA, FREEGEN GEL 3 AL DIA. PROPONGO  LLEVAR A CIRUGÍA Y ROTAR EL LENTE PORQUE ESTÁ ROTADO 10ª CON LAS MANECILLAS DEL RELOJ  Y HA PERDIDO GRAN PARTE DEL PODER Y LA PACIENTE NO ESTÁ CONTENTA. CON LA VISIÓN Y PARA APROVECHAR Y LAVAR EL BAG CAPSULAR PENSANDO EN ALGUNA INFECCIÓN INICIAL POR P. ACNES. SE DA ORDEN DE IMPLANTE SECUNDARIO DE LENTE OD BAJO ANESTESIA GENERAL. PREQUIRÚRGICOS. \r\nSE  EXPLICAN RIESGOS Y POSIBLES COMPLICACIONES:  RUPTURA DEL SACO,  REGRESO A LA POSICIÓN ACTUAL, AFAQUIA, NECESIDAD DE OTRAS CIRUGÍAS. \r\n', 39, '2014-08-21 10:56:45'),
(31, 2773, 'YA TIENE BIOMETRIA DE AMBOS OJOS', 39, '2014-08-21 14:53:37'),
(32, 2769, 'PACIENTE CON OJO SECO SEVERO. REQUIERE AC POLIACRILICO AL 2% CADA 12 HR Y CARBOXIMETILCELULOSA 0.5% 4 AL DIA EN AO PARA EVITAR QUE HAGA ÚLCERAS POR RESEQUEDAD Y POR LO TANTO COMPROMISO DE LA VISIÓN.  REQUIERE EL MEDICAMENTO DE MANERA INDEFINIDA. SE HACE CTC POR 6 MESES. \r\nEL RIESGO SI NO SE APLICA LOS MEDICAMENTOS ES COMPROMISO VISUAL POR ULCERAS CORNEALES ', 39, '2014-08-21 15:06:47'),
(33, 2781, 'ESTA HISTORIA NO CORRESPONDE A ESTA PACIENTE ', 39, '2014-08-22 10:51:05'),
(34, 2241, 'Trae Examen de Pentacam: No hay queratocono, en la actualidad, hay signos de cambios incipientes por adelgazamiento paracentral minimo temporal inferior. Belin Ambrosio normal OD, Limite en ekevacion de cara anterior del OS. Mapa aberrometrico sin alteración grande.\r\nC/ Observación, se explica importancia de no rascado ocular. Control en 6 meses', 9, '2014-08-22 16:10:14'),
(35, 2839, 'ORDEN PARA RESECCIÓN + PLASTIA PTERIGION OS ', 39, '2014-08-26 10:07:35'),
(36, 2792, 'PACIENTE QUE SOLICITA SE LE HAGA CTC PARA LAS GOTAS QUE SE REQUIEREN PARA LA CIRUGÍA DE CATARATA DEL OJO IZQUIERDO\r\nSE ORDENA GATIFLOXACINA 0.5% 1 GOTA CADA 4 HORAS EN OJO OPERADO POR 8 DIAS DESPUÉS DE LA CRUGÍA\r\nACETATO PREDNISOLONA 1% 1 GOTA 4 VECES AL DIA EN OJO OPERADO POR 1 MES DESPUES DE CIRUGÍA\r\nESTAS GOTAS SON ESENCIALES PARA PODER LLEVAR A CABO EL PROCEDIMIENTO', 39, '2014-08-26 10:10:35'),
(37, 2848, 'CITA EN 3 MESES CON OFTALMOLOGIA', 39, '2014-08-26 12:31:57'),
(38, 2938, 'cita con optometría ', 39, '2014-08-28 16:56:43'),
(39, 2798, '25-08/14\r\nvuelve a revisión. Se siente bien pero con la retirada del punto en córnea el viernes pasado, hace 3 días, no le mejoró completamente la visión\r\nav od: 20/30  os: 20/800    refracción  os: +12.50 esf: mejora a 20/30\r\n  pio: 17/22\r\nbio os: ojo tranquilo, córnea tranpsarente, ca ant formada, iris sano, no veo lente en sulcus y sólo veo la háptica azul del lio de 3 piezas en el eje visual. Lio está luxado y caído a cámara posterior-  vítreo silene, macula sana, nervio rosado, exc 0.5, retina aplicada\r\nconducta: la llevo urgente a evaluación con retinólogo dr. Mauricio Arango al medio día, quien la evalúa y confirma que el lio está luxado. Le da orden de implante secundario de lio+ vitrectomia post urgente\r\nSe le explica a la paciente lo ocurrido y que debe ser lelvada nuevamente a cirugía \r\nentiende y acepta', 39, '2014-08-29 14:34:28'),
(40, 2961, 'cita con neuologia o neurocirugía urgente\r\nangioresonancia cerebral simple y contrastada urgente\r\ncreatinina\r\n', 39, '2014-09-02 09:13:05'),
(41, 2960, 'PACIENTE CON HTO SEVERA POR IRIDOTOMIAS Y ESTEROIDES.\r\nTIENE UNOS NERVIOS MUY SOSPECHOSOS DE GLAUCOMA POR LO QUE ORDENO OCT DE NERVIO OPTICO Y CITA EN 1 MES\r\nCONTINUAR KRITANTEK IGUAL, 3 A OFTENO Y DESMONTE DE PREDNISOLONA ', 39, '2014-09-02 09:24:28'),
(42, 2968, 'ORDEN DE OCT DE NERVIO ÓPTICO AMBOS OJOS POR SOSPECHA DE GLAUCOMA ', 39, '2014-09-02 13:06:17'),
(43, 1775, 'El OCT de Macula muestra DMRE no exudativa, estadio medio.\r\nSe ordena Multiareds y Fórmula de gafas= +3.00/+3.50-0.75x60', 9, '2014-09-04 10:35:04'),
(44, 1953, 'Trae Paquimetria= OD: 550/ OS: 525 (+1.00)\r\nOCT N.O. 29/08/2014  Area: 2.4/2.1  C/DH: 0.65/0.63 C/DV: 0.51/0.65 CFN: 103/78  CFNI: 105/84 Morf CFN: OD: normal 360, OS: 1 h fuera limites, 2h limite, resto normal. CCG: OD: Normal, OS: Limite, mas area nasal.\r\n\r\nC/ Pido CV para definir tratamiento\r\n', 9, '2014-09-04 12:21:13'),
(45, 3144, 'CITA ABIERTA CON OFTALMOLOGIA ', 39, '2014-09-05 07:15:11'),
(46, 3153, 'ME LLAMA LA ATENCIÓN QUE EL PACIENTE MANIFIESTA QUE LE MOLESTA VER "LOS BORDES DE LAS COSAS". ADEMÁS, SE FROTA LOS OJOS MÁS POR TRATAR DE MEJORAR LA MOLESTIA QUE POR PRURITO OCULAR. ESO, ME LLAMA LA ATENCIÓN TAMBIÉN QUE TIENE UNOS NERVIOS ÓPTICOS QUE AUNQUE ROSADOS, SON UN POCO PÁLIDOS PARA SU EDAD Y CON ALGO DE ATENUACIÓN VASCULAR EN LA ELERGENCIA VENOSA.\r\nSE HABLA CON DRA. MARTHA MUCÑOZ, NEUROOFTALMÓLOGA, QUIEN SUGIERE ORDENAR RM DE CRANEO SIMPLE Y CONTRASTADA, CAMPOS VISUALES, OCT DE NERVIO ÓPTICO Y LA EMG DE FIBRA ÚNICA PARA DESCARTAR ATROFIA ÓPTICA PRIMARIA O SECUNDARIA\r\nNO ORDENO POR AHORA EL ELECTRORETINOGRAMA ', 39, '2014-09-05 10:51:26'),
(47, 2517, 'CONDUCTA:  OCT DE NERVIO ÓPTICO AO CITA EN 2 MESES\r\nCON RESULTADO ORDEN PARA RESECCIÓN DE\r\nTUMOR CONJUNTIVAL + PLASTIA OS.', 39, '2014-09-08 07:39:05'),
(48, 2519, 'ORDEN PARA IRIDOTOMIA YAG LASER AMBOS OJOS \r\nPOR AHORA SE DEJA LUNAR EN OD EN OBSERVACIÓN PORQUE NO TIENE SIGNOS DE MALIGNIDAD Y ES UNA LESIÓN QUE TIENE DESDE LA NIÑEZ.  ', 39, '2014-09-08 08:30:27'),
(49, 3296, 'TIENE IRIDOTOMIAS PERMEABLES EN AMBOS OJOS ', 39, '2014-09-09 12:33:23'),
(50, 3321, 'Antecedente ocular= Blefaroplastia superior AO, 08/2009', 9, '2014-09-09 14:58:45'),
(51, 3322, 'A Alergicos= Alergia a PENICILINA', 9, '2014-09-09 15:35:10'),
(52, 2934, 'OD: +0.50 -1.50 X 137  EQUIVALE A -1.00 +1.50 X 47', 39, '2014-09-11 17:30:24'),
(53, 2720, 'Antecedente Ocular Qx Lasik AO hace unos 17 años', 9, '2014-09-11 18:13:41'),
(54, 3101, 'IDX: DESCARTAR TELANGICETASIAS PARAFOVEALES OD VS DMRE ', 39, '2014-09-12 09:43:58'),
(55, 3332, 'lentes segun subjetivo OD:+1.25  OS:+0.75  ADD:+2.00', 16, '2014-09-12 10:38:15'),
(56, 3057, 'SE ORDENA CARBOXIMETILCELULOSA PORQUE TIENE OJO SECO SECUNDARIO A SU ENFERMEDAD DE BASE. REQUIERE USO CRÓNICO DE ESTE MEDICAMENTO', 39, '2014-09-16 13:00:35'),
(57, 3056, 'INCAPACIDAD LABORAL POR EL DÍA DE HOY POR DILATACIÓN PUPILAR ', 39, '2014-09-16 13:07:53'),
(58, 2885, 'SE REPITE CTC DE OCT DE NERVIO ÓPTICO PORQUE SE LO DEVOLVIERON PUES EN LA FÓRMULA MANUAL SE ABREVIÓ EL MARIA. \r\nNO SE VUELVE A REPETIR EL DOCUMENTO. SI REQUIERE NUEVA CORRECCIÓN, DEBE PEDIR CITA POR CONSULTA EXTERNA CON NUEVA ORDEN DE OFTALMOLOGIA ', 39, '2014-09-16 14:01:27'),
