(2937, '', 'EVALUADA POR DR. MIGUEL CUEVAS, ESPECIALISTA EN UVEITIS QUIEN INTERROGA UN PENFIGOIDE OCULAR CICATRIZAL CON COMPLICACIONES.  REQUIERE BIOPSIA DE CONJUNTIVA PARA INICIAR MANEJO CON INMUNOSUPRESIÓN DE MANERA URGENTE.  LE ORDENÓ LAGRICEL  CADA 2 HR EN OD, VISCOTEARS CADA 8 HR, MEDROXIPROGESTERONA CADA 4 HORAS EN LACRIL, ZIMAXID CADA 12 HR EN OD SIN SUSPENDER, ALPHAGAN 1 GOTA CADA 8 HR. \r\nDICE LA NUERA QUE EN LA EPS NO LE AUTORIZARON LA EVISCERACIÒN DEL OJO IZQUIERDO PORQUE "PRIMERO LA TIENE QUE VER EL PROTESISTA". TIENE CITA CON ÉL EL 29 DE SEPTIEMBRE EN CLOFAN.\r\nLA PACIENTE TIENE SOSPECHA DE UNA ENFERMEDAD QUE PUEDE PONER EN RIESGO SU VIDA SI NO SE LE INICIA MANEJO CON INMUNOSUPRESORES LO MÀS PRONTO POSIBLE. YO LE DI ORDEN DE ENUYCLEACIÒN DEL OJO IZQUIERDO Y NUEVAMENTE SE LA REPITO, PORQUE NO TIENE SENTIDO QUE LA VEA PRIMERO EL PROTESISTA OCULAR SIN HABER HECHO EL PROCEDIMIENTO, PUES ÉL NO PUEDE TOMAR LA IMPRESIÓN DE LA PRÓTESIS SI NO HAY UNA CAVIDAD OFTÁLMICA VACÍA. ADEMÁS, DEL OJO IZQUIERDO ENUCLEADO  SE PUEDE TOMAR LA BIOPSIA DE CONJUNTIVA  PARA PODER CONFIRMAR EL DIAGNÓSTICO DE PENFIGOIDE Y MEJORARLE EL DOLOR CRÓNICO QUE TIENE. \r\n\r\nCONDUCTA: ORDEN PARA ENUCLEACIÓN DE OJO IZQUIERDO + BIOPSIA DE CONJUNTIVA OJO IZQUIERDO URGENTE\r\nPACIENTE CON SOSPECHA DE PENFIGOIDE OCULAR CICATRIZAL SEVERO\r\nCITA CON CÓRNEA CON DR. MIGUEL CUEVAS URGENTE \r\nCTC DE LAGRICEL (HIALURONATO SODIO VIALES INDIVIDUALES) CADA 2 HORAS EN OD POR 6 MESES, VISCOTEARS (ACIDO POLIACRILICO 2% ) CADA 8 HR EN OD POR 6 MESES', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '