(2976, '', 'MOTIVO DE CONSULTA Y ENFERMEDAD ACTUAL (INCLUYE ANTECEDENTES):  TRAE OCT DE NERVIO ÓPTICO QUE MUESTRA PROMEDIO DE CAPA DE FIBRAS OD  94,  OS 59, AREA DE ANILLO NORMAL EN OD, DISMINUIDA EN OS, TAMAÑO DISCO OD 2.32. OS 2.07. NO TIENE ADELGAZAMIENTOS FOCALES EN OD Y TIENE UN ADELGAZAMIENTO  SUPERIOR, NASAL Y TEMPORAL EN EL OS. DX: SECUELA DE OCLUSIÓN VASCULAR EN OS. NO TIENE GLAUCOMA EN EL OD.  CAMPOS VISUALES OD NORMAL, OS CON HEMIANOPSIA INFERIOR QUE RESPETA LA LINEA MEDIA.  PAUUIMETRIAS OD  569/568. FOTOS OD  CON EXC 0.6 CON ISNT CONSERVADO, OS CON EXC APROX 0.5 PERO CON PALIDEZ DE LA PARTE SUPERIOR EL NERVIO, SÓLO TIENE REBORDE INFERIOR ROSADO.   TIENE DX DE GLAUCOMA EN TTO CON LATANORPSOT. NO LE AUTORIZARON LA DORZOLAMIDA.  DICE QUE DESDE HACE 6 MESES NO ES CAPAZ DE LEER PORQUE VE MUY BORROSO “COMO A TRAVÉS DE UN NEGATIVO”\r\nCREO QUE NO TIENE GLAUCOMA. TIENE SECUELA DE ENF. VASCULAR EN EL OS CON ATROFIA ÓPTICA SECUNDARIA. \r\nAP:  HIPOTIROIDISMO: TIROXINA  HTA: LOSARTAN, HCTZ       BLOQUEO AV EN 1 GRADO\r\nEXAMEN OFTALMOLÓGICO:   AV CC OD: 20/20  OS:  20/25,   PIO 18/18 \r\nOD: PÁRPADOS SANOS,  CONJUNTIVA SANA, CÓRNEA CLARA,  MENISCO DISMINUIDO, CA ANT VH3, IT SUPERIOR PERMEABLE AMPLIA, GONIO: ANGULOS ABIERTOS EN 360 GRADOS,  IRIS SANO,  CRISTALINO CON ESCLEROSIS,  VITREO SILENTE, MÁCULA SANA, IMAGEN HIPOPIGMENTADA TEMPORAL SUPERIOR A FOVEA,  EXC 0.6 HORIZONTALIZADA. \r\nOS: PÁRPADOS SANOS,  CONJUNTIVA SANA, CÓRNEA CLARA, MENISCO DISMINUIDO, CA ANT VH3,  GONIO: ABIERTOS EN 360 GRADOS,  IRIS SANO,  CRISTALINO CON ESCLEROSIS,  VITREO SILENTE, MACULA CON CAMBIOS PIGMENTARIOS,  EXC 0.5 CON APLATILLAMIENTO TEMPORAL, NERVIO UN POCO PÁLIDO \r\nDIAGNÓSTICO:   1.  ATROFIA ÓPTICA  2. SECUELAS DE GLAUCOMA AGUDO EN OS??  3. OJO SECO?? \r\nCONDUCTA:   CITA EN 6 MESES CON OFTALMOLOGÍA.  LATANOPROST 0.005%  1 DIARIA EN AO POR AHORA PORQUE LA PACIENTE NO DESEA SUSPENDER LAS GOTAS.  CITA CON OPTOMETRIA.  CARBOXIMETILCELULOSA 0.5% 3 AL DIA O A NECESIDAD. \r\n', '', '',