(3548, '', '', 'QUERATITIS MICÓTICA OS CON QPP TECTÓNICA EN ABRIL DE 2014. VENÍA CON NATACYN 3 VECES AL DIA PARA TERMINAR EL FRASCO,  (AUNQUE YO SE LA HABÍA SUSPENDIDO HACIA 1 MES). VIENE A REVISIÓN PORQUE HACE 2 DÍAS PRESENTÓ DOLOR E INFLAMACIÓN DEL PÁRPADO. CONSULTÓ ESE DÍA POR URGENCIAS DE OFTALMOLOGIA EN DONDE LE INTERROGARON UNA RECIDIVA DE LA INFECCIÓN Y LE INICIARON OFTALMOX CADA HORA Y AUMENTAR NATACYN CADA 2 HR.  LA DRA. ALINA ARISTIZÁBAL ME COMENTÓ TELEFÓNICAMENTE QUE LE VEÍA UNA "PLACA DE FIBRINA" DEBAJO DEL BOTÓN. LE SUGERÍ QUE LE ORDENARA UNA ECOGRAFIA URGENTE, CITA CON CÓRNEA HOY.  FUE LLEVADO A STAFF DE LA CLÍNICA CES EN DONDE SE DEFINIÓ QUE POR AHORA NO ES CANDIDATO A QUERATOPRÓTESIS EN EL OS Y QUE SE ESPERARA 2 MESES ANTES DE HACER LA FACO DEL OD, PARA EVALUAR POSIBLES RECIDIVAS DE LA INFECCIÓN EN EL OS DURANTE ESTE TIEMPO, QUE NO LA HIZO. ', 'NO', 'LO DESCRITO ', 'NO ', 'CD 1mt', 'PL+  PR+  C-', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'DERMATOCHALASIS', 'NO TIENE EDEMA PALPEBRAL', '', '', 'SANA', 'LEVE INYECCIÓN CONJUNTIVAL', 'Transparente', 'BOTON CORNEAL DESCOMPENSADO PERO BIEN COAPTADO, NO VEO RECIDIVAS, PUNTOS BIEN, VASCULARIZACIÓN ESTROMAL PROFUNDA CASI EN 360 GRADOS PERO NO VEO PLACA DE FIBRINA DESCRITA POR DRA. ALINA.  TIENE LOS MISMOS HALLAZGOS QUE EN LA ÚLTIMA REVISIÓN ', '', '', '', '', 'VH 2', 'ATALAMIA', '', '', 'SANO', 'ATALAMIA', 'Catarata madura', 'NO EVALUABLE', '', '', '', '', '', '', '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', 'NO EVALUABLE POR CATAR