(1, '136600', 'CIRUGIA DE CATARATA= FACO + LIO DE CP', '-Yodopovidona (O-Q septic) + Moxifloxacina tópicas\n-Tegaderm + blefarostato\n-Incisión 2.8 - viscoelástico en cámara anterior, 2 paracentesis\n-Capsulorexis - Hidrodisección - Hidrodelaminación\n-Facoemulsificación del núcleo con técnica faco chop, stop and chop  segundos\n-Lavado bimanual de restos - Viscoelástico\n.Implante de Lente Intraocular inyectado en saco, monofocal, multifocal\n-Lavado de viscoelástico e hidratación de puertos\n-Cefalexina + celestone simple subconjuntival\n-Oclusión con parche + Moxifloxacina tópica\n'),
(2, '116300', 'CIRUGIA CATARATA= FEC + LIO DE CP', '-Yodopovidona (O-Q septic) + Moxifloxacina tópicas\n-Tegaderm + blefarostato\n-Peritomía superior - Paracentesis - Viscoelástico  en cámara anterior\n-Capsulotomía - rotación de núcleo\n-Incisión en limbo esclerocorneal con tijeras de Wescott\n-Extracción del núcleo con Asa Snellen\n-Lavado de masas con cánula de Simcoe - Viscoelástico en cámara anterior y saco\n-Implante de Lente intraocular, se rota\n-Lavado de viscoelástico - Sutura  con Ethilon 10-0 - Se entierran puntos\n.Sutura de conjuntiva - Gentamicina + Celestone subconjuntival\n-Oclusión con parche + Moxifloxacina tópica\n'),
(3, '082100', 'Resección Chalazion', '-Anestesia local\r\n-Incisión vertical en tarso\r\n-Drenaje del chalazion y resección\r\n-Curetaje de la capsula\r\n-Cauterio'),
(4, '103105', 'Resección Pterigion + Plastia Conjuntiva', '-Anestesia local\r\n-Resección pterigion\r\n-Cauterio\r\n-Fresado de limbo con mototool\r\n-Extraccion de plastia conjuntival superion con limbo\r\n-sutura plastia con Ethilion 10-0'),
(5, '086101', 'Blefaroplastia Superior', '-Marcado área a resecar\r\n-Anestesia local\r\n-Incisión en piel\r\n-Resección de piel y musculo sobrante\r\n-Resección paquete graso nasal y medio\r\n-Sutura piel con premilene 7-0, 3 puntos fijados al elevador y una continua \r\n'),
